Create landing pages icon'=>'Створіть іконку цільової сторінки','Create Content'=>'Створити вміст','Create useful content with a few clicks.'=>'Створюйте корисний вміст у кілька кліків.','Create Demo Content'=>'Створення демо вмісту','Create demo content icon'=>'Створіть іконку демо вмісту','Install Plugins'=>'Встановити плагіни','Install our recommended plugins.'=>'Встановіть наші рекомендовані плагіни.','Recommended Plugins'=>'Рекомендовані плагіни','Recommended plugins icon'=>'Іконка рекомендованих плагінів','Enter Option Name'=>'Введіть назву опції','Select a JSON file and enter Redux option name.'=>'Виберіть файл JSON і введіть назву опції Redux.','Import Redux'=>'Імпорт Redux','Redux import icon'=>'Іконка імпорту Redux','Select a DAT file to import.'=>'Виберіть файл DAT для імпорту.','Import Customizer'=>'Імпорт Налаштовувача','Customizer import icon'=>'Іконка імпорту власного налаштовувача','Select a JSON/WIE file to import.'=>'Виберіть файл JSON/WIE для імпорту.','Import Widgets'=>'Імпорт віджетів','Widgets import icon'=>'Іконка імпорту віджетів','Select a File'=>'Виберіть файл','Info icon'=>'Іконка інформації','Select an XML file to import.'=>'Виберіть файл XML для імпорту.','Import Content'=>'Імпорт вмісту','Content import icon'=>'Іконка імпорту вмісту','Manual Demo File Import'=>'Імпорт демо файлу вручну','Switch back to Theme Predefined Imports'=>'Поверніться до попередньо визначеного імпорту теми','Switch to Manual Import'=>'Перейдіть до ручного імпорту','Tags:'=>'Позначки:','By %s'=>'Від %s','Version: %s'=>'Версія: %s','Theme screenshot'=>'Скріншот теми','There are no predefined import files available for this theme. Please upload the import files manually below.'=>'Для цієї теми немає готових файлів імпорту. Будь ласка, завантажте файли імпорту вручну нижче.','Learn more'=>'Дізнатися більше','It allows you to simply edit everything instead of creating content and layouts from scratch.'=>'Це дозволяє вам просто редагувати все, замість того, щоб створювати вміст і компонування з нуля.','Importing demo data (post, pages, images, theme settings, etc.) is the quickest and easiest way to set up your new theme.'=>'Імпорт демонстраційних даних (записів, сторінок, зображень, налаштувань теми тощо) - це найшвидший і найпростіший спосіб налаштувати нову тему.','%1$sWarning: your server is using %2$sPHP safe mode%3$s. This means that you might experience server timeout errors.%4$s'=>'%1$sПопередження: ваш сервер використовує безпечний режим %2$sPHP%3$s. Це означає, що ви можете зіткнутися з помилками таймауту сервера.%4$s','Install & Activate'=>'Встановити та активувати','Want to use the best plugins for the job? Here is the list of awesome plugins that will help you achieve your goals.'=>'Хочете використовувати найкращі плагіни для роботи? Ось список чудових плагінів, які допоможуть вам досягти ваших цілей.','Install Recommended Plugins'=>'Встановити рекомендовані плагіни','Visit Site'=>'Відвідати сайт','Theme Settings'=>'Налаштування теми','Congrats, your demo was imported successfully. You can now begin editing your site.'=>'Вітаємо, вашу демонстрацію було успішно імпортовано. Тепер ви можете приступити до редагування вашого сайту.','Import Complete!'=>'Імпорт завершено!','Importing animation'=>'Імпорт анімації','Please sit tight while we import your content. Do not refresh the page or hit the back button.'=>'Будь ласка, зачекайте, поки ми імпортуємо ваш вміст. Не оновлюйте сторінку або натискайте кнопку "назад".','Importing Content'=>'Імпорт вмісту','Continue & Import'=>'Продовжити та імпортувати','Go Back'=>'Назад','Back icon'=>'Іконка Назад','Loading...'=>'Завантаження...','Lock icon'=>'Іконка замка','Checkmark icon'=>'Іконка галочки','Star icon'=>'Іконка зірки','All required/recommended plugins are already installed. You can import your demo content.'=>'Всі необхідні/рекомендовані плагіни вже встановлені. Ви можете імпортувати свій демонстраційний вміст.','To ensure the best experience, installing the following plugins is strongly recommended, and in some cases required.'=>'Щоб забезпечити найкращий досвід, настійно рекомендується, а в деяких випадках і обов’язково, встановити наведені нижче плагіни.','Before We Import Your Demo'=>'Перш ніж ми імпортуємо вашу демонстрацію','The %2$sOne Click Demo Import%3$s plugin requires %2$sPHP 5.6+%3$s to run properly. Please contact your hosting company and ask them to update the PHP version of your site to at least PHP 7.4%4$s Your current version of PHP: %2$s%1$s%3$s'=>'Для належної роботи плагіна %2$sOne Click Demo Import%3$s потрібен %2$sPHP 5.6+%3$s. Будь ласка, зверніться до вашої хостингової компанії і попросіть їх оновити версію PHP вашого сайту принаймні до PHP 7.4%4$s Ваша поточна версія PHP: %2$s%1$s%3$s','Import your content, widgets and theme settings with one click. Theme authors! Enable simple demo import for your theme demo data.'=>'Імпортуйте вміст, віджети та налаштування теми одним кліком. Автори тем! Увімкніть простий демонстраційний імпорт для демонстраційних даних вашої теми.','https://wordpress.org/plugins/one-click-demo-import/'=>'https://wordpress.org/plugins/one-click-demo-import/','One Click Demo Import'=>'One Click Demo Import']];